import React, { useState, useEffect } from "react";
import ReactApexChart from "react-apexcharts";
import axios from "axios";

const CL = serverData.plot ? serverData.plot.Low["0"] : 0;
const DL = serverData.plot ? serverData.plot.Low["1"] : 0;
const NL = serverData.plot ? serverData.plot.Low["2"] : 0;
const RL = serverData.plot ? serverData.plot.Low["3"] : 0;
const ML = serverData.plot ? serverData.plot.Low["4"] : 0;
const CH = serverData.plot ? serverData.plot.High["0"] : 0;
const DH = serverData.plot ? serverData.plot.High["1"] : 0;
const NH = serverData.plot ? serverData.plot.High["2"] : 0;
const RH = serverData.plot ? serverData.plot.High["3"] : 0;
const MH = serverData.plot ? serverData.plot.High["4"] : 0;
console.log("CL:", CL);
console.log("DL:", DL);
console.log("NL:", NL);
console.log("RL:", RL);
console.log("ML:", ML);
console.log("CH:", CH);
console.log("DH:", DH);
console.log("NH:", NH);
console.log("RH:", RH);
console.log("MH:", MH);
const CLx = CL / 1000;
const DLx = DL / 1000;
const NLx = NL / 1000;
const RLx = RL / 1000;
const MLu = ML / 1000;
const CHa = CH / 1000;
const DHa = DH / 1000;
const NHa = NH / 1000;
const RHa = RH / 1000;
const MHa = MH / 1000;
const ApexChart = () => {
  const [serverData, setServerData] = useState({});
  const [formData, setFormData] = useState({
    CLX: 0,
    DLX: 0,
    NLX: 0,
    RLX: 0,
    MLX: 0,
    CHA: 0,
    DHA: 0,
    NHA: 0,
    RHA: 0,
    MHA: 0,
  });

  async function fetchData() {
    try {
      const response = await axios.get("http://localhost:5000/optimize");
      console.log("Response data:", response.data);
      setServerData(response.data);
    } catch (error) {
      console.error("Error fetching data from the server:", error);
    }
  }

  useEffect(() => {
    fetchData(); // Call the fetchData function when the component mounts
  }, []);

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: parseFloat(value) });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // You can use the updated formData to update the chart data as needed
    console.log("Form data submitted:", formData);
  };

  console.log("Server data:", serverData);

  const series = [
    {
      name: "Low",
      data: [formData.CLX, formData.DLX, formData.NLX, formData.RLX, formData.MLX],
    },
    {
      name: "High",
      data: [formData.CHA, formData.DHA, formData.NHA, formData.RHA, formData.MHA],
    },
  ];

  const [options] = useState({
    chart: {
      type: "bar",
      height: 350,
      stacked: true,
    },
    plotOptions: {
      bar: {
        horizontal: true,
        dataLabels: {
          total: {
            enabled: true,
            offsetX: 0,
            style: {
              fontSize: "13px",
              fontWeight: 900,
            },
          },
        },
      },
    },
    stroke: {
      width: 1,
      colors: ["#fff"],
    },
    title: {
      text: "Production Distribution",
    },
    xaxis: {
      categories: ["Delhi", "Chennai", "Mumbai", "Nagpur", "Raipur"],
      labels: {
        formatter: function (val) {
          return val + "K";
        },
      },
    },
    yaxis: {
      title: {
        text: undefined,
      },
    },
    tooltip: {
      y: {
        formatter: function (val) {
          return val + "K";
        },
      },
    },
    fill: {
      opacity: 1,
    },
    legend: {
      position: "top",
      horizontalAlign: "left",
      offsetX: 40,
    },
  });

  return (
    <>
      <div id="chart">
        <ReactApexChart options={options} series={series} type="bar" height={350} />
      </div>
      <form onSubmit={handleSubmit}>
        <label>
          CLX:
          <input type="number" name="CLX" value={formData.CLX} onChange={handleInputChange} />
        </label>
        {/* Repeat the above label and input for other variables */}
        <button type="submit">Update Chart</button>
      </form>
    </>
  );
};

export default ApexChart;
